import React from "react";
import Popup from "reactjs-popup";
import './profile2.css';
import {
  StyleSheet,
  Text,
  View,
  Image,
  TouchableOpacity,
  Modal,
  ScrollView
} from 'react-native';

 
function ModalModify(){
  return(
  <Popup trigger={<TouchableOpacity style={styles.buttonContainer} activeOpacity={.7}>
                      <Text>Edit Profile</Text>  
                  </TouchableOpacity>
    } modal>
    {close => (
      <div className="modal">
        <a className="close" onClick={close}>
          &times;
        </a>
        <div className="header"> Your Profile </div>
        <div className="content">
        <View style={styles.popupContent}>
            <ScrollView contentContainerStyle={styles.modalInfo}>
                <Image style={styles.image} source={{uri: 'https://bootdey.com/img/Content/avatar/avatar2.png'}}/>
                <Text style={styles.email}>"nombre"</Text>
                <Text style={styles.email}>"email"</Text>
                <Text style={styles.email}>"bogota"</Text>
            </ScrollView>
        </View>

        </div>
        <div className="actions">
          <Popup
            trigger={<button className="button"> Save </button>}
            position="top center"
            closeOnDocumentClick
          >
            <span>
              Guardar.
            </span>
          </Popup>
          <button
            className="button"
            onClick={() => {
              close();
            }}
          >
            close
          </button>
        </div>
      </div>
    )}
  </Popup>
  )}
  
  const styles = StyleSheet.create({
    header:{
      backgroundColor: "#00CED1",
    },
    headerContent:{
      padding:30,
      alignItems: 'center',
    },
    image:{
      width:90,
      height:90,
      borderRadius:45,
    },
    email:{
      marginHorizontal:10
    },
    cardTittle:{
      color:"#808080",
      fontSize:22,
      marginBottom:5,
      textAlign:"left",
    },
    avatar: {
      width: 130,
      height: 130,
      borderRadius: 63,
      borderWidth: 4,
      borderColor: "white",
      marginBottom:10,
    },
    name:{
      fontSize:22,
      color:"#FFFFFF",
      fontWeight:'600',
    },
    profileDetail:{
      alignSelf: 'center',
      marginTop:200,
      alignItems: 'center',
      flexDirection: 'row',
      position:'absolute',
      backgroundColor: "#ffffff"
    },
    photosContainer:{
      flexDirection: 'row',
      flexWrap: 'wrap',
      height: 'auto',
    },
    photosCard:{
      marginTop:10,
      marginLeft:50,
      marginRight:10,
    },
    photo:{
      width:113,
      height:113,
      marginTop:5,
      marginRight:5,
    },
    detailContent:{
      margin:10,
      alignItems: 'center'
    },
    title:{
      fontSize:20,
      color: "#00CED1"
    },
    count:{
      fontSize:18,
    },
    bodyContent: {
      flex: 1,
      alignItems: 'center',
      padding:30,
      marginTop:40
    },
    textInfo:{
      fontSize:18,
      marginTop:20,
      color: "#696969",
    },
    buttonContainer: {
      marginTop:10,
      height:45,
      flexDirection: 'row',
      justifyContent: 'center',
      alignItems: 'center',
      marginBottom:20,
      width:250,
      borderRadius:30,
      backgroundColor: "#00CED1",
    },
    description:{
      fontSize:20,
      color: "#00CED1",
      marginTop:10,
      textAlign: 'center'
    },
    popup: {
      backgroundColor: 'white',
      marginTop: 80,
      marginHorizontal: 20,
      borderRadius: 7,
    },
    popupOverlay: {
      flex: 0,
      marginTop: 30
    },
    popupContent: {
      //alignItems: 'center',
      margin: 5,
      height:250,
    },
    popupHeader: {
      marginBottom: 45
    },
    popupButtons: {
      marginTop: 15,
      flexDirection: 'row',
      borderTopWidth: 1,
      borderColor: "#eee",
      justifyContent:'center'
    },
    popupButton: {
      flex: 1,
      marginVertical: 16
    },
    btnClose:{
      height:20,
      backgroundColor:'#20b2aa',
      padding:20
    },
    modalInfo:{
      alignItems:'center',
      justifyContent:'center',
    }
  });
   

  export default ModalModify;
